import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  paper: {
    // width: "100%",
    // height: "100%",
    shadowColor: "#000",
    borderRadius: 4,
    overflow: "hidden",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
});

export default styles;
